import React from 'react';
import { Link } from 'react-router-dom';

const PlaylistsList = ({ url, playlists }) => {

    return (
        <ul>
            {playlists.map( playlist => 
                // <Playlist key={playlist.id} playlist={playlist} deletePlaylist={deletePlaylist} /> /
                <Link key={playlist.id} to={`${url}/${playlistId}/songs`}>{playlist.name}</Link>
            )}
        </ul>
    )
}

export default PlaylistsList;

